const black = 'black';
const blue = '#0000ff';
const red = '#ff0000';
const yellow = '#ffff00'; 
const purple = '#800080';
const green = '#00ff00';
const orange = 'ffa500';
const grey = '#808080';
export const colors = {
    black,
    blue,
    red,
    yellow,
    purple,
    green,
    orange,
    grey
};
export const defaultColor = black;

const choosingState = 'choose';
const drawingState = 'draw';
export const drawStates = {
    choosingState,
    drawingState,
};
